r($,"b5P","aDg",()=>{var q=3000,p="Kue Basah",o="2 hari",n=1000,m="1 hari"
return A.b([A.jj("B01","Kue Lapis",q,p,"assets/images/kue lapis.jpeg",500,"Kue Lapis merupakan salah satu kue tradisional Indonesia yang memiliki tampilan cantik dengan lapisan warna-warni yang tersusun rapi. Terbuat dari campuran tepung beras, santan, gula pasir, dan sedikit garam, kue ini memiliki tekstur kenyal dan lembut di setiap gigitannya. \nSetiap lapisannya dikukus secara bertahap, menciptakan perpaduan warna yang menggugah selera dan menjadi ciri khas tersendiri dari kue ini. Selain tampilannya yang menarik, aroma gurih santan berpadu manisnya gula membuat kue lapis digemari berbagai kalangan, dari anak-anak hingga orang tua.",o),A.jj("B02","Onde-Onde",n,p,"assets/images/onde-onde.jpeg",500,"Onde-Onde adalah salah satu jajanan tradisional yang paling populer di Indonesia, dikenal dengan bentuknya yang bulat dan taburan wijen di seluruh permukaannya. Lapisan luarnya terbuat dari tepung ketan yang digoreng hingga kecokelatan dan renyah, sementara bagian dalamnya berisi kacang hijau manis yang lembut. Perpaduan rasa gurih dari wijen dan adonan ketan berpadu sempurna dengan isian kacang hijau yang legit, menciptakan sensasi rasa yang khas dan disukai banyak orang. Selain rasanya yang nikmat, Onde-Onde juga memiliki aroma harum khas wijen yang menggugah selera sejak gigitan pertama.\nKue ini sering disajikan dalam berbagai acara seperti arisan, hajatan, hingga perayaan hari besar. Dengan bentuknya yang sederhana namun menggoda, Onde-Onde menjadi simbol jajanan pasar klasik yang tak lekang oleh waktu.",o),A.jj("B03","Dadar Gulung",2000,p,"assets/images/dadar gulung.jpeg",n,"Dadar Gulung adalah kue tradisional Indonesia yang terkenal dengan bentuk gulungannya yang rapi dan warna hijau khas dari daun pandan. Terbuat dari adonan tepung terigu, telur, santan, dan pandan, dadar ini dimasak menjadi lembaran tipis menyerupai pancake, kemudian diisi dengan parutan kelapa yang dicampur gula merah cair, menciptakan rasa manis gurih yang memanjakan lidah.\nAroma pandan yang harum berpadu dengan legitnya gula merah membuat kue ini menjadi salah satu jajanan pasar yang selalu digemari. Teksturnya lembut di luar dengan isian yang sedikit lengket dan kaya rasa di dalamnya.",m),A.jj("B04","Putu Ayu",q,p,"assets/images/putu ayu.jpeg",n,"Putu Ayu adalah kue tradisional yang dikenal karena bentuknya yang cantik menyerupai bunga dan warna hijaunya yang lembut. Terbuat dari campuran tepung terigu, santan, gula, dan sari pandan, kue ini dikukus hingga mengembang lembut dengan aroma harum yang khas. Bagian atasnya diberi taburan kelapa parut yang gurih, memberikan kontras rasa dan tekstur yang pas antara lembut, manis, dan sedikit asin. Kue ini menjadi salah satu jajanan pasar favorit karena tampilannya menarik dan rasanya yang sederhana namun lezat. Putu Ayu sering disajikan dalam berbagai acara seperti arisan, syukuran, atau sebagai teman minum teh di sore hari.\nDengan kombinasi warna hijau dan putih yang menawan serta aroma pandan yang menggoda, Putu Ayu tidak hanya memanjakan lidah, tapi juga indah dipandang..",o),A.jj("B05","Lemper",q,p,"assets/images/lemper.jpeg",450,"Lemper, kue tradisional yang dibuat dari ketan pulen berisi suwiran ayam berbumbu gurih atau abon, dibungkus rapi dengan daun pisang yang memberi aroma khas saat dikukus atau dipanggang. Rasa gurih dari ketan berpadu sempurna dengan isian ayam yang lembut dan sedikit manis, menciptakan cita rasa yang mengenyangkan meski berukuran kecil.\nKue ini sering dijadikan sajian dalam acara keluarga, syukuran, hingga bekal perjalanan karena praktis dan tahan cukup lama. Teksturnya sedikit lengket namun lembut di mulut, membuatnya cocok dinikmati kapan saja, terutama bersama teh hangat. Aroma daun pisang yang harum berpadu dengan rasa gurih ketan menjadikan lemper tetap menjadi favorit banyak orang.",o),A.jj("B06","Nagasari Pisang",q,p,"assets/images/nagasari pisang.jpeg",300,"Nagasari Pisang termasuk jajanan tradisional yang lembut dan harum, dibuat dari campuran tepung beras, santan, dan sedikit gula yang dikukus bersama potongan pisang di dalamnya. Adonannya dibungkus daun pisang sebelum dikukus, memberi aroma khas yang menenangkan sekaligus rasa gurih alami.\nTeksturnya lembut dan sedikit kenyal, sementara rasa manis pisang berpadu sempurna dengan gurihnya adonan santan. Kue ini sering disajikan dalam acara keluarga, hajatan, hingga sebagai camilan sore hari karena rasanya ringan dan mengenyangkan. Warna putih dari adonan berpadu dengan kuning alami pisang menciptakan tampilan sederhana namun menggugah selera..",m),A.jj("B07","Kue Pukis",5000,p,"assets/images/pukis.jpeg",500,"Kue Pukis termasuk jajanan tradisional yang banyak digemari karena teksturnya empuk dan rasanya manis lembut. Terbuat dari campuran tepung terigu, telur, gula, ragi, dan santan, lalu dipanggang di cetakan setengah lingkaran hingga permukaannya sedikit kecokelatan.\nAromanya wangi dan menggugah selera, apalagi saat baru diangkat dari cetakan. Bagian dalamnya lembut dan agak lembap, berpadu dengan berbagai topping seperti cokelat, keju, atau meses yang menambah cita rasa manis gurih.",o),A.jj("B08","Kue Putu",2500,p,"assets/images/kue putu.jpeg",n,"Kue Putu punya ciri khas unik dengan suara siulan kukusannya yang khas saat dijajakan. Terbuat dari tepung beras yang diisi gula merah cair, kemudian dikukus di dalam cetakan bambu kecil yang menghasilkan aroma harum berpadu dengan wangi pandan dan kelapa.\nSaat digigit, gula merah di bagian tengahnya meleleh lembut, memberi sensasi manis yang hangat di mulut. Teksturnya lembut, sedikit padat di luar namun lumer di dalam, cocok dinikmati selagi hangat dengan taburan kelapa parut yang gurih di permukaannya.\nKue ini sering ditemui di pasar malam atau penjual keliling, namun sekarng dapat dipesan di sini yaa, kue putu ini juga menjadi salah satu jajanan tradisional yang membawa nuansa nostalgia.",m),A.jj("B09","Kue Lupis Ketan Pandan",q,p,"assets/images/LUPIS KETAN PANDAN.jpeg",300,"Kue Lupis Ketan Pandan memiliki cita rasa khas yang berasal dari ketan pulen berpadu aroma daun pisang dan pandan yang harum. Adonan ketan dibungkus rapat membentuk segitiga, kemudian dikukus hingga matang dan bertekstur lengket lembut. Setelah itu, lupis disajikan dengan taburan kelapa parut segar dan siraman gula merah cair yang kental serta manis legit. Rasa gurih dari kelapa parut dan manisnya gula merah menciptakan kombinasi sempurna, membuat kue ini jadi favorit banyak orang terutama saat disantap di pagi atau sore hari. Warna hijau alami dari daun pandan menambah kesegaran tampilan sekaligus aroma yang menggugah selera.",m),A.jj("B10","Kue Pie",3500,p,"assets/images/kue pie.jpeg",350,"Kue Pie memiliki perpaduan rasa dan tekstur yang unik, dengan kulit luar yang renyah serta isian lembut yang manis atau gurih. Kulit pie dibuat dari adonan tepung terigu, mentega, dan sedikit gula yang dipanggang hingga berwarna keemasan dan harum. Bagian dalamnya bisa diisi dengan berbagai varian seperti custard lembut, potongan buah segar, cokelat, hingga keju sesuai selera.\nKue ini sering disajikan dalam berbagai acara, dari pesta hingga hidangan penutup di kafe dan toko kue modern. Rasa manisnya tidak berlebihan, sementara tekstur kulitnya yang garing memberikan sensasi kontras yang menyenangkan di setiap gigitan..",o),A.jj("B11","Apem",q,p,"assets/images/Apem.jpeg",500,"Apem menjadi salah satu kue tradisional yang lekat dengan nuansa budaya dan makna syukur. Terbuat dari campuran tepung beras, santan, gula, dan ragi yang difermentasi, kemudian dikukus atau dipanggang hingga mengembang lembut dengan aroma khas yang menggugah selera.\nTeksturnya empuk dengan sedikit kekenyalan, sementara rasanya manis ringan dan terasa gurih dari santan. Warna apem biasanya putih kekuningan atau agak kecokelatan tergantung cara memasaknya. Kue ini sering disajikan dalam acara adat, kenduri, atau syukuran sebagai simbol harapan dan keberkahan..",o),A.jj("B12","Klepon",2500,p,"assets/images/klepon.jpeg",2000,"Klepon menjadi salah satu jajanan tradisional yang paling dikenal dan disukai banyak orang. Terbuat dari tepung ketan yang diberi pewarna hijau alami dari daun pandan atau suji, kemudian dibentuk bulat kecil dan diisi dengan gula merah cair di bagian tengahnya. Setelah direbus hingga mengapung, klepon dilumuri kelapa parut segar yang memberi sensasi gurih saat disantap.\nBegitu digigit,mmmm gula merah di dalamnya langsung meleleh di mulut, berpadu sempurna dengan tekstur lembut ketan dan kelapa yang sedikit kasar. Perpaduan rasa manis, gurih, dan aroma pandan yang harum membuat klepon selalu menghadirkan kenangan jajanan pasar tempo dulu.",m)],A.ap("A<nU>"))})
r($,"b5Q","aDh",()=>{var q="Kue Kering"
return A.b([A.lM("K01","Nastar",75e3,q,"assets/images/nastar.jpeg",25,"Nastar selalu jadi kue favorit di setiap momen perayaan, terutama saat Lebaran. Terbuat dari adonan tepung terigu, mentega, dan kuning telur yang dipanggang hingga berwarna keemasan, lalu diisi dengan selai nanas manis legit yang dibuat dari buah nanas segar. Teksturnya lembut, sedikit rapuh, dan langsung lumer di mulut saat digigit. \nRasa manis asam dari selai nanas berpadu sempurna dengan adonan kue yang gurih dan buttery, menciptakan sensasi khas yang sulit ditolak. Bentuknya mungil dan berkilau karena olesan kuning telur di permukaannya, menjadikannya tampil cantik di toples saji.\nKue ini sering menjadi simbol kehangatan dan kebersamaan, menemani momen silaturahmi bersama keluarga. Nastar juga tahan lama, bisa disimpan hingga beberapa minggu dalam wadah tertutup rapat tanpa kehilangan rasa dan kerenyahannya.","Nanas"),A.lM("K02","Kastengel",85e3,q,"assets/images/kastengel.jpeg",28,"Kastengel adalah kue kering gurih yang selalu hadir di setiap perayaan besar seperti Lebaran dan Natal. Terbuat dari campuran tepung terigu, mentega, kuning telur, dan parutan keju edam, kue ini dipanggang hingga berwarna keemasan dengan aroma keju yang menggoda.\nRasanya gurih, asin, dan sedikit buttery dengan tekstur renyah di luar namun lembut saat digigit. Setiap batang kecilnya sering ditaburi keju parut di atasnya, menambah cita rasa sekaligus membuat tampilannya semakin menggugah selera.","Keju"),A.lM("K03","Kue Sagu",85e3,q,"assets/images/kue sagu.jpeg",28,"Kue Sagu dikenal dengan teksturnya yang ringan dan mudah hancur di mulut. Terbuat dari tepung sagu, mentega, gula halus, dan sedikit keju parut, kue ini punya cita rasa gurih manis yang khas dan aroma wangi yang lembut saat dipanggang.\nSetiap gigitan memberi sensasi renyah di luar namun langsung lumer begitu menyentuh lidah. Rasanya tidak terlalu manis, pas untuk dinikmati bersama kopi atau teh hangat. Bentuknya yang kecil dan berpola cantik menjadikannya salah satu kue kering favorit di toples sajian hari raya.","Manis dan Gurih"),A.lM("K04","Kue Lidah Kucing",4e4,q,"assets/images/lidah kucing.jpeg",28,"Kue Lidah Kucing punya ciri khas bentuk tipis memanjang dengan tekstur super renyah yang langsung patah saat digigit. Terbuat dari campuran mentega, gula, putih telur, dan tepung terigu, kue ini memiliki rasa manis lembut berpadu aroma vanila yang harum.\nNama \u201clidah kucing\u201d berasal dari bentuknya yang pipih dan melengkung, menyerupai lidah hewan kecil tersebut. Proses pemanggangannya harus tepat agar hasilnya tipis, kering, dan berwarna keemasan di tepiannya. Kue ini sering menjadi pilihan camilan ringan atau suguhan khas saat hari raya karena tampilannya yang rapi dan rasanya yang ringan.","Vanila"),A.lM("K05","Semprit",6e4,q,"assets/images/Semprit.jpeg",28,"Kue Semprit dikenal dengan bentuknya yang cantik menyerupai bunga kecil dan aroma mentega yang harum saat baru keluar dari oven. Terbuat dari campuran tepung terigu, mentega, telur, dan gula halus, kue ini memiliki tekstur renyah namun tetap lembut di mulut.\nRasanya manis gurih dengan sentuhan butter yang khas. Di bagian tengahnya sering diberi topping seperti choco chips, selai strawberry, nanas, atau parutan keju yang menambah variasi rasa dan tampilan menarik. Kue ini kerap menjadi andalan di meja tamu saat hari raya atau sebagai camilan sehari-hari karena rasanya yang ringan dan tidak mudah bikin enek.","Coklat, Strawberry, Nanas, Keju"),A.lM("K06","Putri Salju",65e3,q,"assets/images/putri salju.jpeg",30,"Putri Salju selalu mencuri perhatian dengan bentuk bulan sabitnya yang lembut dan balutan gula halus putih menyerupai salju. Terbuat dari campuran tepung terigu, mentega, kacang mede atau almond halus, serta sedikit vanila, kue ini punya tekstur rapuh yang langsung lumer di mulut.\nRasanya manis gurih dengan aroma mentega yang lembut, memberikan sensasi lembut sejak gigitan pertama. Taburan gula halus di seluruh permukaannya menambah keindahan dan memberi rasa manis yang pas tanpa berlebihan.","Vanilla"),A.lM("K07","Kue Kacang",6e4,q,"assets/images/kue kacang.jpeg",20,"Kue Kacang punya aroma khas yang langsung bikin nostalgia. Dibuat dari kacang tanah yang disangrai lalu ditumbuk halus, dicampur dengan tepung, gula, dan minyak, kue ini dipanggang hingga matang sempurna.\nRasanya gurih manis dengan tekstur yang renyah namun mudah lumer di mulut. Permukaannya sering diberi olesan kuning telur sehingga tampak mengilap dan menggugah selera. Kue klasik ini sering jadi favorit karena rasanya sederhana tapi nagih \u2014 biasanya tersedia untuk camilan saat berkumpul bersama keluarga.","Kacang"),A.lM("K08","Kue Chocolate Chip Cookies",5e4,q,"assets/images/chip cookies.jpeg",20,"Kue Chocolate Chip Cookies adalah kue kering klasik yang selalu jadi favorit segala usia. Terbuat dari adonan mentega, gula, dan tepung yang dipanggang hingga renyah di luar namun tetap sedikit chewy di dalam.\nSetiap gigitannya menghadirkan sensasi manis dengan potongan cokelat chip yang lembut menambah cita rasa khas cokelat yang bikin nagih. Kue ini cocok dinikmati kapan saja \u2014 saat santai, menemani kopi, atau sebagai camilan manis di sore hari.","manis dan chocolate"),A.lM("K09","Kue Bawang",35e3,q,"assets/images/bawang.jpeg",20,"Kue bawang adalah camilan gurih yang selalu jadi favorit saat kumpul keluarga. Terbuat dari campuran tepung terigu, telur, margarin, dan taburan bawang yang harum, kemudian digoreng hingga kering keemasan. Teksturnya tipis, renyah, dan punya rasa gurih bawang yang khas, bikin susah berhenti ngemil setelah satu gigitan.","gurih dan renyah"),A.lM("K10","Akar kelapa",35e3,q,"assets/images/akar kelapa.jpeg",20,"Kue tradisional khas Indonesia yang bentuknya menyerupai akar tanaman dengan lilitan unik. Terbuat dari campuran tepung ketan, santan, gula, dan sedikit garam, kemudian digoreng hingga berwarna keemasan. Teksturnya renyah di luar namun tidak terlalu keras, dengan rasa gurih manis yang pas di lidah. Biasanya disajikan saat hari raya atau sebagai camilan sore hari ditemani teh hangat.","gurih, manis")],A.ap("A<nV>"))})
r($,"b5R","aDi",()=>{var q="Kue Ultah",p="Besar",o="Happy Birthday!",n="Wish You All the Best!",m="Happy Anniversary!"
return A.b([A.nX("U01","Black Forest",15e4,q,"assets/images/black forest.jpeg",10,"Kue cokelat klasik yang tak lekang oleh waktu. Black Forest hadir dengan lapisan bolu cokelat lembut yang diselimuti krim segar dan dihiasi taburan cokelat serut di seluruh permukaannya. Di bagian atasnya, ceri merah manis menambah sentuhan warna dan rasa asam segar yang menyeimbangkan manis legitnya krim dan cokelat.\nAromanya khas dan menggoda, sementara setiap potongannya memberikan kombinasi rasa lembut, manis, dan sedikit segar yang sempurna di lidah. Cocok untuk momen ulang tahun yang hangat, perayaan kecil bersama keluarga, atau sekadar memanjakan diri di hari istimewa.","Sedang","Selamat Ulang Tahun!"),A.nX("U02","Red Velvet",175e3,q,"assets/images/Red Velvet Cake.jpeg",8,"Kue ini punya warna merah khas yang langsung bikin jatuh hati. Teksturnya lembut dan agak moist, dengan rasa manis yang pas berpadu sama cream cheese frosting yang gurih dan lembut. Setiap potongannya berasa mewah tapi tetap ringan di lidah.\nRed Velvet ini sering jadi pilihan favorit buat ulang tahun karena tampilannya elegan dan rasanya nggak bikin enek.",p,o),A.nX("U03","Rainbow Cake",15e4,q,"assets/images/rainbow cake.jpeg",8,"Kue ulang tahun berlapis warna pelangi yang cerah dan menggoda ini selalu berhasil mencuri perhatian di setiap perayaan. Setiap lapisannya punya tekstur lembut dan rasa manis yang pas, berpadu dengan krim putih lembut yang melapisinya dengan halus. Saat dipotong, warna-warni lapisan dalamnya terlihat cantik banget \u2014 bikin siapa pun yang lihat langsung pengin mencicipi. Selain tampilannya yang ceria, Rainbow Cake juga punya cita rasa lembut dan ringan di mulut, cocok buat semua usia.",p,o),A.nX("U04","Sponge Cake",13e4,q,"assets/images/sponge cake.jpeg",8,"Kue ulang tahun klasik dengan tekstur ringan dan empuk seperti spons, memberikan sensasi lembut setiap kali digigit. Sponge Cake ini punya rasa manis yang lembut dan aroma vanila yang harum, cocok untuk siapa pun yang suka kue ringan tapi tetap nikmat. \nBiasanya disajikan apa adanya atau dihias dengan krim, buah segar, hingga cokelat leleh sesuai selera. Teksturnya yang lembut membuat kue ini juga sering jadi dasar berbagai kreasi tart ulang tahun. Ukurannya cukup besar, pas untuk dibagikan bersama keluarga dan teman, dengan tulisan \u201cHappy Birthday!\u201d di atasnya yang menambah kesan hangat dan meriah.",p,o),A.nX("U05","Cheesecake",16e4,q,"assets/images/cheescake.jpeg",12,"Kue lembut berbahan dasar keju krim ini punya cita rasa manis gurih yang khas dan begitu memanjakan lidah sejak gigitan pertama. Teksturnya halus, lembut, dan creamy \u2014 terasa lumer di mulut dengan aroma keju yang harum tapi tetap ringan, tidak bikin enek. Setiap lapisannya dibuat dengan bahan pilihan dan teknik pemanggangan yang pas, sehingga menghasilkan keseimbangan sempurna antara rasa manis, gurih, dan sedikit asam alami dari kejunya.","Kecil",n),A.nX("U06","Brownis",8e4,q,"assets/images/brownis.jpeg",12,"Kue cokelat yang satu ini selalu jadi favorit di setiap kesempatan. Teksturnya padat namun lembut, dengan rasa cokelat yang kaya dan sedikit rasa pahit khas kakao asli yang bikin rasanya seimbang, tidak terlalu manis. Saat digigit, bagian dalamnya terasa fudgy dan moist, sementara bagian pinggirnya sedikit renyah \u2014 perpaduan sempurna yang bikin nagih di setiap potongannya.\nBrownis ini cocok disajikan untuk ulang tahun sederhana maupun sebagai hadiah manis untuk orang tersayang. Aroma cokelatnya yang harum langsung terasa begitu kotaknya dibuka, Cocok dinikmati bersama teh atau kopi.","sedeng",n),A.nX("U07","Cupcake",1e4,q,"assets/images/cup cake.jpeg",1500,"Kue mungil yang dikemas dalam cup kertas ini selalu berhasil mencuri perhatian dengan tampilannya yang manis dan warna-warni. Teksturnya lembut dan empuk, berpadu sempurna dengan topping krim manis di atasnya yang dihias dengan berbagai dekorasi cantik seperti sprinkle, cokelat serut, atau potongan buah kecil. Setiap gigitannya menghadirkan rasa manis lembut yang bikin suasana langsung terasa lebih hangat dan ceria.\nCupcake ini sering jadi pilihan favorit untuk ulang tahun anak-anak, hadiah kecil untuk sahabat, atau pelengkap pesta kecil di rumah. Meski berukuran kecil, tampilannya imut dan elegan, cocok dijadikan kue ulang tahun bergaya modern yang praktis tapi tetap berkesan.","kecil",n),A.nX("U08","Chocolate Cloud Cake",7e4,q,"assets/images/cloud coklat.jpeg",12,"Kue cokelat lembut yang satu ini benar-benar sesuai namanya \u2014 selembut awan. Teksturnya ringan, halus, dan lumer begitu menyentuh lidah, menghadirkan sensasi manis pekat khas cokelat premium yang langsung bikin jatuh cinta di gigitan pertama. Setiap lapisannya dibuat dengan adonan lembut yang dipanggang sempurna, menghasilkan rasa cokelat yang kaya tapi tetap ringan di mulut.\nChocolate Cloud Cake ini cocok banget untuk momen spesial seperti ulang tahun atau perayaan anniversary. Disajikan dengan taburan gula halus atau lelehan cokelat di atasnya, tampilannya sederhana namun elegan.","sedeng",m),A.nX("U09","Tiramisu Cake",9e4,q,"assets/images/Tiramisu cake.jpeg",12,"Kue khas Italia yang satu ini punya cita rasa elegan dan lembut yang sulit dilupakan. Tiramisu Cake terbuat dari lapisan sponge lembut yang direndam dengan kopi espresso, lalu disusun bergantian dengan krim keju mascarpone yang halus dan creamy. Perpaduan rasa pahit kopi dan manis lembut krimnya menciptakan keseimbangan sempurna yang bikin setiap potongan terasa istimewa.\nAroma kopinya yang khas berpadu dengan taburan bubuk kakao di bagian atas, memberikan sentuhan akhir yang menggoda. Kue ini cocok banget disajikan untuk perayaan ulang tahun, anniversary, atau momen spesial bersama orang terdekat. Ukurannya pas untuk dinikmati bersama keluarga kecil atau sahabat, dan tampilannya yang elegan selalu berhasil mencuri perhatian di meja hidangan.","Sedang",m)],A.ap("A<nW>"))})
